import React from 'react';
import '../../styles/components/layout/Nav.css';
import { NavLink } from "react-router-dom";

const Nav =(props) => {
    return(
        <nav>
            <div>
                <ul>
                    <li><NavLink to="/" className={({ isActive})}>Home</NavLink></li>
                    <li><NavLink to="/Nosotros">Nosotros</NavLink></li>
                    <li><NavLink to="/Novedades">Novedades</NavLink></li>
                    <li><NavLink to="/Contacto">Contacto</NavLink></li>
                    <li><NavLink to="/Galeria">Galeria</NavLink></li>
                    <li><NavLink to="/PlantasInterior">Plantas de Interior</NavLink></li>
                    <li><NavLink to="/PlantasExterior">Plantas de Exterior</NavLink></li>
                </ul>
            </div>


        </nav>

    )

}


export default Nav;
